import React from 'react';
import logo from './images/Android_Robot.png'; // ロゴ画像のインポート

interface IpMacPairCardProps {
  vendor: string;
  os: string;
}

const IpMacPairCard: React.FC<IpMacPairCardProps> = ({ vendor, os }) => {
    return (
      <div className="card">
        <div className="card-body">
          <div style={{ display: 'flex' }}>
            <img src={logo} alt="logo" style={{ width: '20px', marginRight: '10px', alignSelf: 'center' }} /> {/* ロゴ画像の表示 */}
            <div>
              <p className="card-text">Vendor: {vendor}</p>
              <p className="card-text">OS: {os}</p>
            </div>
          </div>
        </div>
      </div>
    );
  };

export default IpMacPairCard;
